      `http://www.bokjiro.go.kr/openapi/rest/gvmtWelSvc?crtiKey=qt%2BHSez0GjoTYvzN9D49cDlbHcVmSSxlKAUmIrLEqtHhnJBf6URyeHVJYuTIP13Hm148dCo3U7qu0QeSF%2FXoZw%3D%3D&callTp=L&pageNum=1&numOfRows=100&lifeArray=004&charTrgterArray=006&trgterIndvdlArray=001&desireArray=500000`
    );
    console.log(data);
  };
  getData();
  return <div className="App"></div>;
}

export default App;
